import { IssueOpenedIcon } from "@primer/octicons-react";
import { Box, Text, Link, StyledOcticon } from '@primer/react'

const Command = (props) => {
    return(
        <Box py={2} display="flex" alignItems="center" alignContent="center" justifyContent="space-between">
            <Box display="inline-flex" alignItems="center">
                <StyledOcticon icon={props.icon || 'IssueOpenedIcon'} />
                <Text ml={2}>{props.name || "Command name"}</Text>
            </Box>
            <Text>{props.command || "⌘"}</Text>
        </Box>
    )
}

export default Command;
